@namespace url("http://www.w3.org/1999/xhtml");

/* to make it appear in the 'google.com' sub-category of userstyles.org */
@-moz-document domain("google.com") { }


/* GENERAL STYLES ******************************/

@-moz-document url-prefix("http://www.google"),              url-prefix("https://www.google"),
               url-prefix("http://images.google"),           url-prefix("https://images.google"),
               url-prefix("http://maps.google"),             url-prefix("https://maps.google"),
               url-prefix("http://news.google"),             url-prefix("https://news.google"),
               url-prefix("http://groups.google"),           url-prefix("https://groups.google"),
               url-prefix("http://books.google"),            url-prefix("https://books.google"),
               url-prefix("http://scholar.google"),          url-prefix("https://scholar.google"),
               url-prefix("http://mail.google"),             url-prefix("https://mail.google"),
               url-prefix("http://blogsearch.google"),       url-prefix("https://blogsearch.google"),
               url-prefix("http://translate.google"),        url-prefix("https://translate.google"),
               url-prefix("http://www.google.com/calendar"), url-prefix("https://www.google.com/calendar"),
               url-prefix("http://picasaweb.google"),        url-prefix("https://picasaweb.google"),
               url-prefix("http://video.google"),            url-prefix("https://video.google"),
               url-prefix("http://docs.google"),             url-prefix("https://docs.google"),
               url-prefix("http://sites.google"),            url-prefix("https://sites.google"),
               url-prefix("http://finance.google"),          url-prefix("https://finance.google") {

.gbh { display: none !important; }

/***********************************************/
/* GBAR (Google bar) ***************************/
#gsr {-moz-column-count: 2;}

#gbar {
  display: block !important;
  position: fixed !important;
  top: 0 !important;
  left: 0 !important;
  right: 0 !important;
  height: 25px !important;
  z-index: 1001 !important;
  margin: 0 !important;
  padding: 0 !important;
  background: #F6F6FF !important;
  border-bottom: solid 1px #99C !important;
  cursor: default !important;
  overflow: hidden;
}
#gbi { /* drop down menu */
  display: block !important;
  visibility: visible !important;
  position: relative !important;
  top: 0 !important;
  left: 0 !important;
  border: none !important;
}

#gbar .gb1, #gbi .gb2 {
  float: left !important;
  height: inherit !important;
  padding: 2px 2px 2px 6px !important;
  margin: 3px 3px 0 5px !important;
  font: menu !important;
  color: black !important;
  text-decoration: none !important;
  cursor: inherit !important;
}
#gbar .gb1:after, #gbi .gb2:after {
  content: "" !important;
  padding: 2px 4px 2px 0 !important;
  margin: 0 -6px 0 2px !important;
}
#gbar a.gb3, #gbi div.gb2 { display: none !important; }
#gbar a:focus { outline: none !important; }

/* IMAGES */
#gbar .gb1:hover,        #gbi .gb2:hover       { background: left no-repeat  url("data:image/gif;base64,") !important; }
#gbar .gb1:hover:after,  #gbi .gb2:hover:after { background: right no-repeat url("data:image/gif;base64,") !important; }

#gbar .gb1:focus,        #gbar b.gb1,             #gbi .gb2:focus,        #gbi b.gb2             { background: left no-repeat  url("data:image/gif;base64,") !important; }
#gbar .gb1:focus:after,  #gbar b.gb1:after,       #gbi .gb2:focus:after,  #gbi b.gb2:after       { background: right no-repeat url("data:image/gif;base64,") !important; }

#gbar .gb1:active,       #gbar b.gb1:hover,       #gbi .gb2:active,       #gbi b.gb2:hover       { background: left no-repeat  url("data:image/gif;base64,") !important; }
#gbar .gb1:active:after, #gbar b.gb1:hover:after, #gbi .gb2:active:after, #gbi b.gb2:hover:after { background: right no-repeat url("data:image/gif;base64,") !important; }
/* END IMAGES */


/***********************************************/
/* TOOLBAR *************************************/

#guser, /* search, images, maps, discussions, books, mail */
div.gaiaNav, /* news */
div.sites-account, /* sites */
#sft .xsm, #ap, p.gseaopt, td.bN.bR /* search options, adv. search, prefs */ {
  display: block !important;
  position: fixed !important;
  top: 26px !important;
  right: 0 !important;
  z-index: 1002 !important;
  height: 0 !important;
  padding: 30px 6px 0 !important;
  margin: 0 !important;
  cursor: default !important;
}
#guser, div.gaiaNav, div.sites-account {
  left: 0 !important;
  border-bottom: solid 1px #0C3942 !important;
}
div.gaiaNav { overflow: hidden !important; }
#guser nobr {
  position: relative !important;
  top: -100px !important;
}

#ap { right: -9px !important; }
p.gseaopt { width: auto !important; }
#sft .xsm br, #ap br, p.gseaopt br, td.bN.bR br { display: none !important; }

#guser nobr > a, div.gaiaNav a, #sft .xsm a, #ap a, p.gseaopt a, td.bN.bR span.toxOdd {
  float: left !important;
  position: relative !important;
  padding: 4px 4px 5px 8px !important;
  margin: 0 4px 0 0 !important; /* right margin = right image width  */
  font: small-caption !important;
  color: white !important;
  text-decoration: none !important;
  text-shadow: 1px 1px 3px black !important;
  cursor: inherit !important;
}

td.bN.bR span[role="link"] {
  text-decoration: none !important;
}

#guser nobr > a, div.gaiaNav a { top: -43px !important; }
#sft .xsm a, p.gseaopt a, td.bN.bR span.toxOdd { top: -27px !important; }
#ap a { top: -40px !important; }

#guser nobr > a:before, div.sites-account a:before, div.gaiaNav a:before, #sft .xsm a:before, #ap a:before, p.gseaopt a:before, td.bN.bR span.toxOdd:before {
  display: inline-block !important;
  margin: 0 6px -4px -2px !important;
  vertical-align: top !important;
}
#guser nobr > a:after, div.sites-account a:after, div.gaiaNav a:after, #sft .xsm a:after, #ap a:after, p.gseaopt a:after, td.bN.bR span.toxOdd:after {
  content: "" !important;
  padding: 4px 4px 5px 0 !important; /* horiz. padding = image width */
  margin: 0 -8px 0 4px !important; /* right margin = text padding + image width; left margin = image width; */
}

#guser nobr > a:active, div.sites-account a:active, div.gaiaNav a:active, #sft .xsm a:active, #ap a:active, p.gseaopt a:active, td.bN.bR span.toxOdd:active {
  padding: 5px 3px 4px 9px !important; /* padding one pixel down & right */
}
#guser nobr > a:active:after, div.sites-account a:active:after, div.gaiaNav a:active:after, #sft .xsm a:active:after, #ap a:active:after, p.gseaopt a:active:after, td.bN.bR span.toxOdd:active:after {
  padding: 5px 3px 4px 1px !important;
  margin: 0 -7px 0 3px !important;
}

#guser a:focus, div.sites-account a:focus, #sft .xsm a:focus, #ap a:focus, p.gseaopt a:focus, td.bN.bR span.toxOdd:focus { outline: none !important; }

#guser u { text-decoration: none !important; }
#gbs { display: none; }
#guser #gbg {
  top: 98px !important;
  right: auto !important;
  padding: 1px 2px !important;
  border: solid 1px #979797 !important;
  background: #F0F0F0 repeat-y 28px url("data:image/gif;base64,R0lGODlhAgABAIAAAOLj4////ywAAAAAAgABAAACAkQKADs=") !important;
  -moz-box-shadow: 4px 4px 2px -2px #8F8F8F !important;
}
#guser #gbg .gb2 {
  margin: 0 4px 0 0 !important;
  padding: 3px 4px 4px 36px !important;
  font: menu !important;
  color: black !important;
}
#guser #gbg .gb2:before {
  margin: 0 15px -1px -31px !important;
}
#guser #gbg .gb2:after {
  display: inline-block !important;
  width: 4px !important;
  height: 15px !important;
  float: right !important;
  margin: -3px -8px -4px 0px !important;
  padding: 3px 0 4px 0 !important;
  content: "" !important;
}



/* IMAGES */
#gb, #guser, div.sites-account, div.gaiaNav { background: teal repeat-x url("data:image/gif;base64,R0lGODlhAQAeAMQAAGmlr7fU2RhqdxhrdxlqdxtseB1teR9ueiNwfCdzfy14gzN8hzuEj0uUn0+WoVOZo1mcpl2eqGOirG6psXSstXmvt36yuoO1vIe4v4u6wUSOl02ZoVelq5rMzwAAAAAAACwAAAAAAQAeAAAFGGCQYZdVURMgRdDjNINAFMaBJMrCaBvXhQA7") !important; }

#guser nobr > a:focus,        div.sites-account a:focus,        div.gaiaNav a:focus,        #sft .xsm a:focus,        #ap a:focus,        p.gseaopt a:focus,        td.bN.bR span.toxOdd:focus        { background: left  no-repeat url("data:image/gif;base64,") !important; }
#guser nobr > a:focus:after,  div.sites-account a:focus:after,  div.gaiaNav a:focus:after,  #sft .xsm a:focus:after,  #ap a:focus:after,  p.gseaopt a:focus:after,  td.bN.bR span.toxOdd:focus:after  { background: right no-repeat url("data:image/gif;base64,") !important; }

#guser nobr > a:hover,        div.sites-account a:hover,        div.gaiaNav a:hover,        #sft .xsm a:hover,        #ap a:hover,        p.gseaopt a:hover,        td.bN.bR span.toxOdd:hover        { background: left  no-repeat url("data:image/gif;base64,") !important; }
#guser nobr > a:hover:after,  div.sites-account a:hover:after,  div.gaiaNav a:hover:after,  #sft .xsm a:hover:after,  #ap a:hover:after,  p.gseaopt a:hover:after,  td.bN.bR span.toxOdd:hover:after  { background: right no-repeat url("data:image/gif;base64,") !important; }

#guser nobr > a:active,       div.sites-account a:active,       div.gaiaNav a:active,       #sft .xsm a:active,       #ap a:active,       p.gseaopt a:active,       td.bN.bR span.toxOdd:active       { background: left  no-repeat url("data:image/gif;base64,") !important; }
#guser nobr > a:active:after, div.sites-account a:active:after, div.gaiaNav a:active:after, #sft .xsm a:active:after, #ap a:active:after, p.gseaopt a:active:after, td.bN.bR span.toxOdd:active:after { background: right no-repeat url("data:image/gif;base64,") !important; }

#guser #gbg .gb2:hover       { background: no-repeat url("data:image/gif;base64,") !important; }
#guser #gbg .gb2:hover:after { background: no-repeat url("data:image/gif;base64,R0lGODlhBAAWAMQAAOHt9eTu9dvr9ePu9dnr9drr9dzs9d/t9eLu9eXv9enw9Nbq9Nvs9d3t9eDu9ePu86jY66/a67zf7crj7d3t9ODu9Lrf7f///wAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAACH5BAEAABcALAAAAAAEABYAAAU2IBRNl/JIU5JUkZpAQQzLQw0hOATskONDhyBQGDxAGkiIYQlhOCGCKKRAnVYJhEUEQbFMRKQQADs=") !important; }

/* END IMAGES */

}


/************************************************/


@-moz-document url-prefix("http://www.google"), url-prefix("https://www.google") {

body[topmargin="3"] { padding-top: 56px !important; } /* Google Web Search */
body[onload="sf()"] { padding-top: 80px !important; } /* Firefox start page */
#doc3 { padding-top: 56px !important; } /* iGoogle */
body[onload="rpv();"] { padding-top: 40px !important; } /* iGoogle themes page */

}

@-moz-document url-prefix("http://mail.google"), url-prefix("https://mail.google") {

body > div > div > div.nH { padding-top: 56px !important; }

}

@-moz-document url-prefix("http://docs.google"), url-prefix("https://docs.google") {

body#editpage { padding-top: 0 !important; }

}

@-moz-document url-prefix("http://images.google"),           url-prefix("https://images.google"),
               url-prefix("http://maps.google"),             url-prefix("https://maps.google"),
               url-prefix("http://news.google"),             url-prefix("https://news.google"),
               url-prefix("http://www.google.com/prdhp"),    url-prefix("https://www.google.com/prdhp"), /* Shopping */
               url-prefix("http://groups.google"),           url-prefix("https://groups.google"),
               url-prefix("http://books.google"),            url-prefix("https://books.google"),
               url-prefix("http://scholar.google"),          url-prefix("https://scholar.google"),
               url-prefix("http://blogsearch.google"),       url-prefix("https://blogsearch.google"),
               url-prefix("http://translate.google"),        url-prefix("https://translate.google"),
               url-prefix("http://www.google.com/calendar"), url-prefix("https://www.google.com/calendar"),
               url-prefix("http://picasaweb.google"),        url-prefix("https://picasaweb.google"),
               url-prefix("http://video.google"),            url-prefix("https://video.google"),
               url-prefix("http://docs.google"),             url-prefix("https://docs.google"),
               url-prefix("http://sites.google"),            url-prefix("https://sites.google"),
               url-prefix("http://finance.google"),          url-prefix("https://finance.google") {

body { padding-top: 56px !important; }

}


/************************************************/
